import './App.css';
import Header from "./component/Header"
import TodoEditor from "./component/TodoEditor"
import TodoList from "./component/TodoList"

function App() {
  const [todo , setTodo] = useState();
  return (
    <div className="App">
      {/* <h2>헬로 리액트</h2> */}
      <Header />
      <TodoEditor />
      <TodoList />
    </div>
  );
}

export default App;
